const WooCommerceRestApi = require("@woocommerce/woocommerce-rest-api").default;


  export default async (_req, res) => {
    const api = new WooCommerceRestApi({
        url: 'https://fleuriland.fr',
        consumerKey: 'ck_8cecfb224e1a6337bc5c978e57572c5d92166bf1',
        consumerSecret: 'cs_654a2f73fed125a745baa4ab032fbf6ef29b0482',
        version: "wc/v3"
      });
      console.log(api);
    try {
      const result = await api.get("products", {
      per_page: 20, // 20 products per page
      })
      console.log(result);
      res.json(result);
    }catch(e) {
